import React from 'react';

import logo180 from '../assets/logo180.png';
import search from '../assets/search.svg';

export class Sidebar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="w-20 h-full bg-red-50 flex flex-col">
                <a href="/">
                        <img src={logo180} alt="logo" 
                            className="
                                mx-auto mb-5 mt-2
                                w-12 py-3
                                block
                            "
                        />
                </a>
                <div className="flex flex-row content-center justify-center bg-blue-50 p-3">
                    <img src={search} className="w-5"/>
                    <h3 className="hidden text-2xl ml-6 my-auto font-bold">Search</h3>
                </div>


            </div>

        )
    }
}
